import React, { useRef } from "react";

export default function Output({ rowHeaders }) {
  const startSelectRef = useRef(null);
  const filteredItems = rowHeaders.filter((item) => item.trim() !== "");
  return (
    // <>
    //   <label for="start_vertex_select">Начальная вершина:</label>
    //   <select name="start_vertex" id="start_vertex_select">
    //     ref={startSelectRef}
    //     <option key={0} value="empty1">1</option>;
    //     {rowHeaders.map((val, ind) => (
    //       <option key={ind} value={val}>
    //         {val}
    //       </option>
    //     ))}
    //   </select>
    //   <label for="end_vertex_select">Конечная вершина:</label>
    //   <select name="end_vertex" id="end_vertex_select">
    //     <option key={0} value="empty2">1</option>;
    //     {rowHeaders
    //       .filter((val) => val !== startSelectRef.current.value)
    //       .map((val, ind) => (
    //         <option key={ind} value={val}>
    //           {val}
    //         </option>
    //       ))}
    //   </select>
    // </>
    <div>
      <div>
        <label htmlFor="dropdown1">Начальная вершина:</label>
        <select id="dropdown1" ref={startSelectRef}>
        <option key={0} value="empty"></option>;
          {filteredItems.map((item, index) => (
            <option key={index} value={item}>
              {item}
            </option>
          ))}
        </select>
      </div>
      <div>
        <label htmlFor="dropdown2">Конечная вершина:</label>
        <select id="dropdown2">
                  <option key={0} value="empty"></option>;
          {filteredItems
            .filter((val) => val !== startSelectRef.current.value)
            .map((item, index) => (
              <option key={index} value={item}>
                {item}
              </option>
            ))}
        </select>
      </div>
    </div>
  );
}
